import React from 'react';


const GetContact = ({ user_name, message }) => {
    return (
          <div className="commentSection">
                  <h2 className="strong">{user_name}</h2>
                  <p className="commentMessage">{message}</p>
                </div>
        );
      }

export default GetContact;
